    return (
        
        <div className="card">
          <div className="top">
            <h2 className = "name">{props.name}</h2>
            <Avatar />
          </div>
          <div className="bottom">
            <p className = "info">{props.tele}</p>
            <p className="info">{props.email}</p>
          </div>
        </div>
    );
};

